import { ReactFragment } from "react";
import { JSX } from "react/jsx-runtime";
import { Country } from "./helpers/TypeInterfaces"
import { BsFillArrowUpSquareFill, BsFillArrowDownSquareFill } from "react-icons/bs";

interface CountryLineProps {
    guessInfo: Country;
    correctInfo: Country;
}

var populationLine;
var landAreaLine;
var continentLine;

const CountryLine = ({ guessInfo, correctInfo }: CountryLineProps) => {

    if (guessInfo.population > correctInfo.population) {
        populationLine = <div>{guessInfo.population.toLocaleString()}<BsFillArrowDownSquareFill/></div>;
    }
    else if (guessInfo.population < correctInfo.population) {
        populationLine = <div>{guessInfo.population.toLocaleString()}<BsFillArrowUpSquareFill/></div>;
    }
    else {
        populationLine = <div>{guessInfo.population.toLocaleString()}</div>;
    }

    if (guessInfo.landArea > correctInfo.landArea) {
       landAreaLine = <div>{guessInfo.landArea.toLocaleString()}<BsFillArrowDownSquareFill/></div>;
    }
    else if (guessInfo.landArea < correctInfo.landArea) {
        landAreaLine = <div>{guessInfo.landArea.toLocaleString()}<BsFillArrowUpSquareFill/></div>;
    }
    else {
        landAreaLine = <div>{guessInfo.landArea.toLocaleString()}</div>;
    }

    if (typeof(guessInfo.continent) === "string") {
        continentLine = <div>{guessInfo.continent}</div>;
    }
    else {
        continentLine = <div>{guessInfo.continent[0]}/{guessInfo.continent[1]}</div>
    }

    return (
        <tr>
            <td>
                {guessInfo.name}
            </td>
            <td>
                {continentLine}
            </td>
            <td>
                {populationLine}
            </td>
            <td>
                {landAreaLine}
            </td>
        </tr>
    )
};

export default CountryLine;
